eval("module.exports = {\n  whichVersionDoINeed: {\n    questions: ['Which version do I need?'],\n    answers: ['In case you want to analyze the code and learn about recommended coding practices then you can use *jSparrow Free*. *jSparrow Starter* is also free and it allows to apply *15 refactoring rules*. You can get the Starter activation code by filling out a registration form. If you want to improve your source base using *all rules* then you can get *jSparrow Pro*.'],\n    nextSuggestions: ['whatIsPro', 'whatIsStarter', 'whatIsFree', 'talkToHuman']\n  },\n  whereToGet: {\n    questions: ['Where can I get jSparrow Pro?'],\n    answers: ['To order a new license, please visit https://jsparrow.eu/get-jsparrow/. In case you want a special offer for your company, feel free to contact my team at https://jsparrow.eu/contact/.'],\n    nextSuggestions: ['whatIs', 'howToInstall', 'whichEditions', 'whichVersionDoINeed', 'talkToHuman']\n  },\n  talkToHuman: {\n    questions: ['May I talk to a human?', 'I want to talk to a human.', 'How can I reach you?'],\n    answers: ['Sure, my team will be happy to respond to your inquiries. In case you want technical support, please send an email to support@jsparrow.eu. This will automatically create a ticket at jSparrow Help Center. If you want a special offer for jSparrow Pro, please fill out the contact form at https://jsparrow.eu/contact/'],\n    nextSuggestions: ['howToInstall', 'whatIs', 'bugReport', 'suggestion']\n  },\n  interactiveRules: {\n    questions: ['Are there interactive rules?'],\n    answers: ['Yes, there are rules that can be configured to fit your needs. E.g., in the ‘Rename Fields’ rule you can configure how to generate the new field names; in the ‘Standard Logger’ rule you can configure which logging level to use in different scenarios.'],\n    nextSuggestions: ['howToInstall', 'bugReport', 'talkToHuman']\n  },\n  canICreateMyOwnRule: {\n    questions: ['Can I create my own rule?'],\n    answers: ['The rule engine does not allow customers to create new rules. Reasons include: transforming code is a mission-critical task. Each rule has to be thoroughly studied and tested before going to production. However, my team is open to suggestions. If you want to see a feature in jSparrow, feel free to contact us.'],\n    nextSuggestions: ['suggestion', 'interactiveRules', 'howDoesItWork', 'talkToHuman']\n  },\n  howDoesItWork: {\n    questions: ['How does jSparrow work?'],\n    answers: ['jSparrow can be started on any Java source. After selecting the rules you want to apply, jSparrow computes the changes and displays them side-by-side on a diff view. You can choose to unselect changes on certain files for different rules. The original sources are not affected until the changes are approved.'],\n    nextSuggestions: ['howToInstall', 'bugReport']\n  },\n  help: {\n    questions: ['Hello there! May I help you with something?'],\n    answers: [],\n    nextSuggestions: ['noThanks', 'whatIs', 'suggestion', 'bugReport', 'talkToHuman']\n  },\n  noThanks: {\n    questions: [\"I'm just having a look.\", 'no', 'no.', 'no!', 'No', 'No.', 'No!'],\n    answers: ['Ok. Enjoy visiting our documentation!'],\n    nextSuggestions: ['bugReport', 'suggestion', 'whatIs']\n  },\n  suggestion: {\n    questions: ['I want to suggest a rule.', 'I have a suggestion'],\n    answers: [\"Awesome! I recommend creating a '*Rule suggestion*' ticket at jSparrow Help Center  https://jsparrow.atlassian.net/servicedesk/. Alternatively, you can send an email to support@jsparrow.eu.\"],\n    nextSuggestions: ['bugReport', 'howManyRules', 'talkToHuman']\n  },\n  bugReport: {\n    questions: ['I want to report a bug.', 'I want to create a bug report'],\n    answers: ['Thank you for your valuable feedback! The recommended way to do that is to file a bug report at jSparrow Help Center https://jsparrow.atlassian.net/servicedesk. Alternatively, you can send an email to support@jsparrow.eu.'],\n    nextSuggestions: ['suggestion', 'howManyRules', 'talkToHuman']\n  },\n  whatIs: {\n    questions: ['What is jSparrow?', 'What does jSparrow do?'],\n    answers: ['jSparrow is a tool that provides automatic refactoring of Java sources.', 'jSparrow is a tool that refactors Java code automatically for you. Thus, saving maintenance time.'],\n    nextSuggestions: ['howDoesItWork', 'whichEditions', 'howDoIBenefit', 'whichPlatforms']\n  },\n  howToInstall: {\n    questions: ['How to install jSparrow?', 'How to install?', 'How do I install?'],\n    answers: ['You can drag and drop the installation button from the Eclipse Marketplace into your IDE. You can also install jSparrow directly from the update site https://update.jsparrow.eu.'],\n    nextSuggestions: ['howToInstallJmp', 'whichPlatforms', 'whereToGet', 'talkToHuman']\n  },\n  whichEditions: {\n    questions: ['Which jSparrow versions are available?', 'Which jSparrow editions are available?', 'Which editions are available?', 'Which versions are available?', 'jSparrow versions?', 'versions?'],\n    answers: ['There are three jSparrow versions: *jSparrow Free*, *jSparrow Starter*, and *jSparrow Pro*.'],\n    nextSuggestions: ['whatIsStarter', 'whatIsFree', 'whatIsPro', 'whichVersionDoINeed']\n  },\n  whatIsJEP: {\n    questions: ['What is the jSparrow Eclipse Plugin?'],\n    answers: ['The jSparrow Eclipse Plugin (JEP) is the integration of jSparrow in the Eclipse IDE. JEP is the recommended product as it has a rich user interface that allows customers to have full control over the refactorings they perform on the source base.'],\n    nextSuggestions: ['whatIsRule', 'whatIsJMP', 'whereToGet', 'howDoesItWork']\n  },\n  whatIsJMP: {\n    questions: ['What is the jSparrow Maven Plugin?'],\n    answers: ['The jSparrow Maven Plugin (JMP) is a continuous integration tool to apply automatic refactoring. It applies nearly the same rules as jSparrow Eclipse Plugin but works without user interaction. The rule selection and configuration can be provided through yml files.'],\n    nextSuggestions: ['howToInstall', 'whatIsJEP', 'talkToHuman']\n  },\n  howDoIBenefit: {\n    questions: ['What are the benefits of using jSparrow?', 'What are the benefits?', 'What do I benefit?', 'What benefits do I get?'],\n    answers: ['Among others, some benefits of using jSparrow are: reducing repetitive work, boosting performance, fixing security leaks, improving readability, and more.']\n    /* Write something for most important tags */\n    ,\n    nextSuggestions: ['howIsRepetitiveWorkReduced', 'howIsSecurityImproved', 'howIsPerformanceImproved']\n  },\n  howIsRepetitiveWorkReduced: {\n    questions: ['How is repetitive work reduced?'],\n    answers: ['jSparrow helps to automatically resolve some trivial but yet important cleanups over the entire code base. Thus, you have more time to focus on your tasks and avoid human mistakes, too.'],\n    nextSuggestions: ['whereToGet', 'howToInstall', 'whatIsStarter', 'whichEditions', 'howDoIBenefit']\n  },\n  howIsSecurityImproved: {\n    questions: ['How is security improved?'],\n    answers: ['jSparrow provides a list of rules for preventing injection attacks of different kinds.'],\n    nextSuggestions: ['whereToGet', 'howToInstall', 'whatIsStarter', 'whichEditions', 'howDoIBenefit']\n  },\n  howIsPerformanceImproved: {\n    questions: ['How is Performance affected?'],\n    answers: ['Since Java keeps evolving, there are always new features introduced that are more efficient than older alternatives. jSparrow offers various refactorings with a focus on performance improvement.'],\n    nextSuggestions: ['whereToGet', 'howToInstall', 'whatIsStarter', 'whichEditions', 'howDoIBenefit']\n  },\n  howToInstallJmp: {\n    questions: ['How to install the jSparrow Maven Plugin?'],\n    answers: ['To install the JMP you simply need to add the plugin repository in the pom.xml file or in the settings.xml file. No additional downloads are required. The refactoring can be started from the command line. Further configuration can be provided with command line parameters, profiles, or yml files. See also http://localhost:8081/maven/getting-started.html#installation.'],\n    nextSuggestions: ['whatIsJMP', 'whichPlatforms', 'talkToHuman']\n  },\n  whichPlatforms: {\n    questions: ['In which platforms is jSparrow integrated?'],\n    answers: ['jSparrow is integrated into the Eclipse IDE as jSparrow Eclipse Plugin, into Maven as jSparrow Maven Plugin, and into GitHub as jSparrow Cloud App.'],\n    nextSuggestions: ['whatIsJEP', 'whatIsJMP']\n  },\n  whatIsStarter: {\n    questions: ['What is jSparrow Starter?'],\n    answers: ['jSparrow starter allows you to apply 15 Rules for FREE. After filling a registration form you will receive an activation key for jSparrow Starter. Afterwards you can apply the changes of jSparrow rules tagged as FREE.'],\n    nextSuggestions: ['howDoIBenefit', 'whatIsFree', 'whatIsPro', 'whatIsRule']\n  },\n  whatIsFree: {\n    questions: ['What is jSparrow Free?'],\n    answers: ['jSparrow Free allows you to view the changes computed by jSparrow rules. After installing jSparrow, you will automatically have jSparrow Free. It does not require licensing or registration.'],\n    nextSuggestions: ['howDoIBenefit', 'whatIsStarter', 'whatIsPro', 'whatIsRule']\n  },\n  whatIsPro: {\n    questions: ['What is jSparrow Pro?'],\n    answers: ['jSparrow Pro provides the full power of jSparrow refactoring. You can view and apply all changes from all jSparrow rules.'],\n    nextSuggestions: ['howDoIBenefit', 'whatIsStarter', 'whatIsRule']\n  },\n  whatIsRule: {\n    questions: ['What is a jSparrow Rule?', 'What is a jSparrow refactoring Rule?', 'What is a Rule?'],\n    answers: ['A jSparrow rule is a definition of a granular refactoring performed by jSparrow. The scope of a single rule is very specific. E.g., the ‘Use Functional Interface’ rule transforms anonymous classes to lambda expressions when possible. Rules can be combined to obtain a broader refactoring.'],\n    nextSuggestions: ['whatIsProfile', 'howDoIBenefit', 'interactiveRules', 'talkToHuman']\n  },\n  whatIsProfile: {\n    questions: ['What is a profile?'],\n    answers: ['A profile is a list of jSparrow rules. You can create any number of profiles with the rules of your choice. Profiles can be exported from jSparrow Eclipse to the jSparrow Maven Plugin. The intention is to define company standards as sets of rules and to simplify the rule selection.'],\n    nextSuggestions: ['whatIsRule', 'howDoIBenefit', 'howManyRules', 'talkToHuman']\n  },\n  howManyRules: {\n    questions: ['How many rules are implemented in jSparrow?'],\n\n    /* Maybe we can remove this. We will for sure forget to update it. */\n    answers: ['By now, there are over 78 refactoring rules implemented in jSparrow.'],\n    nextSuggestions: ['whatIsReleaseSchedule', 'whichEditions', 'talkToHuman']\n  },\n  whatIsReleaseSchedule: {\n    questions: ['What is the release schedule?'],\n    answers: ['A new jSparrow version is released monthly. Each release contains at least one new rule. Every third release contains at least three rules. The releases take place on the third Thursday of each month.'],\n    nextSuggestions: ['howManyRules', 'whichEditions', 'talkToHuman']\n  },\n  \"default\": {\n    questions: [],\n    answers: ['Sorry, I didn\\'t catch that. Would you like to contact a human?'],\n    nextSuggestions: ['talkToHuman', 'whatIs']\n  }\n};//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./docs/.vuepress/beautifulchat.js\n");

